,"metadata":{},"output_type":"display_data"}],"source":["table1 <- table1 %>% \n","    group_by(weekday) %>%\n","    mutate(percent_total = (number_of_rides/total) * 100 )\n","#To view table1\n","tibble(table1)"]},{"cell_type":"markdown","id":"50835cb3","metadata":{"papermill":{"duration":0.026511,"end_time":"2024-11-05T01:25:39.029831","exception":false,"start_time":"2024-11-05T01:25:39.00332","status":"completed"},"tags":[]},"source":["From the new table1, the total number of riders and the percentage of ridership per day are easily readable. One can easily observe that there is a change in Cyclistic ridership during the weekends. \n","Friday, Saturday and Sunday rank as the days wih the 3 lowest bike use numbers, with Saturday being especially low at 87078. Also, one observes that Saturday and Sunday are the only days during which Cyclistic subscribed members make up less than 90% of the total riders. The lower number of bikes used during the weekends suggests that most Cyclistic users use the bikes to and fro their places of work. This also explains the reduction in percentage use. "]},{"cell_type":"markdown","id":"ab382429","metadata":{"papermill":{"duration":0.025981,"end_time":"2024-11-05T01:25:39.082809","exception":false,"start_time":"2024-11-05T01:25:39.056828","status":"completed"},"tags":[]},"source":["The insights I can devise from the analysis to convert as many of the remaining casual riders into subscribed members, and improve Cyclistic subscription sign up numbers include: \n","\n","1. Siting of Cyclistic bike station close to or at office buildings with large numbers of workers. This way, the stations and bikes are closer to the demographic that usually subscribe, and the proximity can help convince casual or non-riders to take up subscriptions.\n","\n","2. The organization of partnership programs with corporations with large employee numbers. Asides increasing visibility to Cyclistic's largest marketbase (office employees), the partnerships can provide subsidized membership fees, helping convince more non-riders to buy Cyclistic subscriptions. These partnerships can also be used to facilitate firm-wide fitness programs.\n","\n","3. Canceling the Cyclistic casual ride option. This is a drastic step, but considering that at any given time, less than 20% of Cyclistic's customer base is made up by casual riders, removing the option might nudge most of these casual riders to become members. This option would work better if the casual ride option is made far less attractive by the use of tools like price gaps and membership subscription benefits. "]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":5968358,"sourceId":9748779,"sourceType":"datasetVersion"}],"dockerImageVersionId":30749,"isGpuEnabled":false,"isInternetEnabled":false,"language":"r","sourceType":"notebook"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.4.0"},"papermill":{"default_parameters":{},"duration":31.805725,"end_time":"2024-11-05T01:25:39.231244","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2024-11-05T01:25:07.425519","version":"2.6.0"}},"nbformat":4,"nbformat_minor":5}